import './App.css';
import Header from './Header/Header';
import Main from './main/Main';
import DefaultPage from './pages/DefaultPage';

const App = () => {
  return (
    <div className="App">
      <Main />
      <div>
        <Header />
        <DefaultPage />
      </div>
    </div>
  );
};

export default App;
